import React from "react";

const About = () => {
  return(
    <React.Fragment>
      <h1>I live to make badass jewelry for you.</h1>
      <p>
        Hello friends! I’m Bethany, but most of the world calls me Rockit. I’m the owner & artist here at Crimson Claw. I live in the gorgeous state of Colorado with my love & adorable puppers. My friends are my world & my Harley is my freedom. I started silversmithing about 6 months ago, but my dreams of being a jeweler started years earlier. When I was 13 I was diagnosed with Lupus & severe kidney disease. I was granted a Make-A-Wish trip & told I would likely not live to see high school graduation. Tapping into my creative side truly kept me going. I spent my days surrounded by gemstones & seed beads. I never stopped fighting. Today, sitting in my studio creating beautiful jewelry for you is more than a blessing. I am living my dream. Thank you all for the support. It’s a pleasure having you on this journey with me.
      </p>
    </React.Fragment>


  );
}

export default About;
